import * as GS from '../../styles/global';
import Link from 'next/link';

const Bloggy = ({ posts }) => {
	console.log(posts);
	return (
		<S.BlogContainer>
			<div>
				{posts.map((post) => {
					console.log(post.excerpt);
				})}
			</div>
			<div>Right</div>
		</S.BlogContainer>
	);
};

export default Bloggy;
